import './App.css';
import UserForm from './components/Userform';
import Useritems from './components/Useritems';

function App() {
  return (
    <div>
      <div className='container'>
        <div className='row'>
          <div className='col-md-6'>
            <UserForm />
          </div>
        </div>
          <div className='col-md-6'>
            <Useritems />
          </div>
      </div>
    </div>


  );
}

export default App;
